import React from 'react';

export class Button extends React.Component {
    handleClick = () => {
        var val = parseInt(this.props.children);
        alert(val);
    }

    render() {
        return (
            <div>
                <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded" onClick={this.handleClick}>{this.props.children}</button>
            </div>
        );
    }
}
